import React, { useState, useEffect } from 'react';
import { Card, Row, Col, Statistic, Progress, Tag, Table, Spin } from 'antd';
import { TeamOutlined, MessageOutlined, CheckCircleOutlined, TrophyOutlined } from '@ant-design/icons';
import { PieChart, Pie, Cell, ResponsiveContainer, BarChart, Bar, XAxis, YAxis, CartesianGrid, Tooltip } from 'recharts';
import { eventAPI } from '../services/api';

const TeamAnalytics = () => {
  const [loading, setLoading] = useState(true);
  const [teamActivity, setTeamActivity] = useState({});
  const [memberProgress, setMemberProgress] = useState({});

  useEffect(() => {
    loadAnalytics();
  }, []);

  const loadAnalytics = async () => {
    try {
      setLoading(true);
      const [teamRes, progressRes] = await Promise.all([
        eventAPI.getTeamActivity(),
        eventAPI.getMemberProgress()
      ]);
      
      setTeamActivity(teamRes.data);
      setMemberProgress(progressRes.data);
    } catch (error) {
      console.error('Failed to load team analytics:', error);
    } finally {
      setLoading(false);
    }
  };

  const getTeamChartData = () => {
    return Object.entries(teamActivity).map(([name, stats]) => ({
      name,
      messages: stats.total_messages,
      decisions: stats.decisions_made,
      role: stats.role
    }));
  };

  const getCategoryData = () => {
    const allCategories = {};
    Object.values(teamActivity).forEach(stats => {
      Object.entries(stats.categories).forEach(([category, count]) => {
        allCategories[category] = (allCategories[category] || 0) + count;
      });
    });
    
    return Object.entries(allCategories).map(([category, count]) => ({
      category,
      count
    }));
  };

  const columns = [
    {
      title: 'Team Member',
      dataIndex: 'name',
      key: 'name',
      render: (name, record) => (
        <div>
          <div style={{ fontWeight: 'bold' }}>{name}</div>
          <Tag color="blue">{record.role}</Tag>
        </div>
      )
    },
    {
      title: 'Total Messages',
      dataIndex: 'total_messages',
      key: 'messages',
      sorter: (a, b) => a.total_messages - b.total_messages,
      render: (count) => <Statistic value={count} prefix={<MessageOutlined />} />
    },
    {
      title: 'Decisions Made',
      dataIndex: 'decisions_made',
      key: 'decisions',
      sorter: (a, b) => a.decisions_made - b.decisions_made,
      render: (count) => <Statistic value={count} prefix={<CheckCircleOutlined />} />
    },
    {
      title: 'Decision Rate',
      key: 'rate',
      render: (_, record) => {
        const rate = record.total_messages > 0 ? (record.decisions_made / record.total_messages * 100) : 0;
        return <Progress percent={Math.round(rate)} size="small" />;
      }
    },
    {
      title: 'Active Months',
      dataIndex: 'months_active',
      key: 'months',
      render: (months) => <Tag color="green">{months?.length || 0} months</Tag>
    },
    {
      title: 'Top Categories',
      key: 'categories',
      render: (_, record) => {
        const topCategories = Object.entries(record.categories || {})
          .sort(([,a], [,b]) => b - a)
          .slice(0, 3);
        
        return topCategories.map(([category, count]) => (
          <Tag key={category} color="purple">
            {category} ({count})
          </Tag>
        ));
      }
    }
  ];

  const tableData = Object.entries(teamActivity).map(([name, stats]) => ({
    key: name,
    name,
    ...stats
  }));

  const COLORS = ['#8884d8', '#82ca9d', '#ffc658', '#ff7300', '#8dd1e1', '#d084d0'];

  if (loading) return <Spin size="large" style={{ display: 'block', margin: '50px auto' }} />;

  return (
    <div style={{ padding: '24px' }}>
      <Card style={{ marginBottom: 24 }}>
        <h2><TeamOutlined /> Team Performance Analytics</h2>
        <p>Analyze team member activity, decision-making patterns, and workload distribution</p>
      </Card>

      {/* Summary Stats */}
      <Row gutter={16} style={{ marginBottom: 24 }}>
        <Col span={6}>
          <Card>
            <Statistic
              title="Team Members"
              value={Object.keys(teamActivity).length}
              prefix={<TeamOutlined />}
            />
          </Card>
        </Col>
        <Col span={6}>
          <Card>
            <Statistic
              title="Total Messages"
              value={Object.values(teamActivity).reduce((sum, stats) => sum + stats.total_messages, 0)}
              prefix={<MessageOutlined />}
            />
          </Card>
        </Col>
        <Col span={6}>
          <Card>
            <Statistic
              title="Total Decisions"
              value={Object.values(teamActivity).reduce((sum, stats) => sum + stats.decisions_made, 0)}
              prefix={<CheckCircleOutlined />}
            />
          </Card>
        </Col>
        <Col span={6}>
          <Card>
            <Statistic
              title="Member Events"
              value={memberProgress.total_events}
              prefix={<TrophyOutlined />}
            />
          </Card>
        </Col>
      </Row>

      {/* Charts */}
      <Row gutter={16} style={{ marginBottom: 24 }}>
        <Col span={12}>
          <Card title="Team Activity Distribution">
            <ResponsiveContainer width="100%" height={300}>
              <BarChart data={getTeamChartData()}>
                <CartesianGrid strokeDasharray="3 3" />
                <XAxis dataKey="name" angle={-45} textAnchor="end" height={100} />
                <YAxis />
                <Tooltip />
                <Bar dataKey="messages" fill="#8884d8" name="Messages" />
                <Bar dataKey="decisions" fill="#82ca9d" name="Decisions" />
              </BarChart>
            </ResponsiveContainer>
          </Card>
        </Col>
        
        <Col span={12}>
          <Card title="Category Distribution">
            <ResponsiveContainer width="100%" height={300}>
              <PieChart>
                <Pie
                  data={getCategoryData()}
                  cx="50%"
                  cy="50%"
                  outerRadius={100}
                  fill="#8884d8"
                  dataKey="count"
                  label={({ category, count }) => `${category} (${count})`}
                >
                  {getCategoryData().map((entry, index) => (
                    <Cell key={`cell-${index}`} fill={COLORS[index % COLORS.length]} />
                  ))}
                </Pie>
                <Tooltip />
              </PieChart>
            </ResponsiveContainer>
          </Card>
        </Col>
      </Row>

      {/* Team Members Table */}
      <Card title="Detailed Team Performance">
        <Table
          columns={columns}
          dataSource={tableData}
          pagination={false}
          scroll={{ x: 1000 }}
        />
      </Card>

      {/* Key Interventions */}
      <Row gutter={16} style={{ marginTop: 24 }}>
        {Object.entries(teamActivity).map(([name, stats]) => (
          <Col span={8} key={name} style={{ marginBottom: 16 }}>
            <Card title={`${name} - Key Interventions`} size="small">
              {stats.key_interventions?.slice(0, 3).map((intervention, index) => (
                <div key={index} style={{ marginBottom: 8, padding: 8, backgroundColor: '#f5f5f5', borderRadius: 4 }}>
                  <Tag color="blue" size="small">{intervention.category}</Tag>
                  <div style={{ fontSize: '12px', marginTop: 4 }}>
                    {intervention.rationale?.substring(0, 80)}...
                  </div>
                </div>
              )) || <div style={{ color: '#999', fontSize: '12px' }}>No key interventions recorded</div>}
            </Card>
          </Col>
        ))}
      </Row>
    </div>
  );
};

export default TeamAnalytics;
